import React from "react";
import { Outlet } from "react-router";
import Log from "../components/Log";
import Poke from "../components/Poke";

const Authenticationlayout =()=>{
    return(
        <div>
            <nav className='bg-white w-full h-full'> 
            <div className='flex items-center justify-end h-16 w-16'>
            <Log /><Poke/>

            </div>
            <div className="flex items-center justify-between p-10 h-20">

            <div >
                <input type={"search"}  className="w-full  px-3 py-2 border shadow-5 border-gray-300 placeholder-gray-500 text-gray-900  rounded-full" placeholder='Enter pokemon name'/>
            </div>
            <div className='border-2 rounded-full border-slate-700'>
              <div className="rounded-full bg-pink-500 w-10 h-10 m-2 p-5"></div>
              </div>
            </div>

</nav>
           <div className='bg-slate-300 h-screen justify-center'>
            <Outlet />
            </div>


        </div>
    )
}
export default Authenticationlayout;
